import React, { useEffect, useState } from 'react'
import axios from 'axios'

function App() {
  const url = "/api"
  const [backendData, setBackendData] = useState ([{}])
  axios 
        .get(url)
        .then((res) => {
          console.log(res);
          setBackendData (res)
        })
        .catch((err) => {
          console.log(err);
        });


  // useEffect (() => {
