  //     data => {
  //       setBackendData (data)
  //     }
  //   ).catch (err => console.log (err))
  // }, [/* empty array for only running on initial render */])

  return (
    <div>
      {(typeof backendData.cars === 'undefined') ? (
        <p>Loading...</p>
      ) : (
          backendData.users.map ((car, i) => (
            <p key={i}>{car}</p>
          ))
      )}
    </div>
  )
}

export default App
